import {  StyleSheet, Text, View } from 'react-native';
import { styles } from '../../style';

function Header() {

    return (
      <View style={styles.header}>
          <Text style={styles.header_text}>Headerrr</Text>
      </View>
    )
  }
  
  export default Header
